    false,nt"url": null,nt"notes": "NODC Accession 0100079 includes chemical,
    time series and underway - surface data collected from MOORINGS in the North Pacific
    Ocean and South Pacific Ocean from 1998-06-22 to 2004-11-23. These data include
    CARBON DIOXIDE - PARTIAL PRESSURE - DIFFERENCE. The instruments used to collect
    these data include Carbon dioxide (CO2) gas analyzer and Carbon dioxide (CO2) laminar
    flow bubble equilibrator (for buoy measurement).nnThese data were collected by Francisco
    Chavez of MONTEREY BAY AQUARIUM RESEARCH INSTITUTE as part of the Mooring TAO170W2S
    data set. CDIAC assigned the following cruise ID(s) to this data set: TAO170W2S_1998_2004,
